import React from 'react'
const Card= (props)=>  {
    return (
        
      <div>
      <Image
        className={styles.Image}
        src="/images/creative.png"
        alt="Next.js Logo"
        width={217}
        height={217}
        priority
      />
      <h2>
        {props.title}
      </h2>
      <p>
        {props.soustitle}
      </p>
      <h6 className={styles.signature}>{props.signature}</h6>

    </div>




        
      
    )
}

export default Card
